import React from "react";
import "./ArrowChevron_big_left.css";

function ArrowChevron_big_left(props) {
  const { arrowChevron_Big_Left, className } = props;

  return (
    <div className={`arrow-chevronbigleft ${className || ""}`}>
      <img className="arrow-chevronbigleft-1" src={arrowChevron_Big_Left} />
    </div>
  );
}

export default ArrowChevron_big_left;
